import React from "react";
import MUIDataTable from "mui-datatables";
import axios from "axios";


export default class Profile extends React.Component {
    constructor(props) {
        super(props);

        const getData = async (e) => {
            (await axios.get(`http://localhost:5000/getAdmins`)).data;
        };

        this.state = {
            data: [getData()],
        };
    }

    

    render() {
        const columns = [
            {
                name: "Delete",
                options: {
                    filter: true,
                    sort: false,
                    empty: true,
                    customBodyRender: (value, tableMeta, updateValue) => {
                        return (
                            <button onClick={() => {
                                const { data } = this.state;
                                data.shift();
                                this.setState({ data });
                            }}>
                                Delete
                            </button>
                        );
                    }
                }
            },
            {
                name: "Edit",
                options: {
                    filter: true,
                    sort: false,
                    empty: true,
                    customBodyRender: (value, tableMeta, updateValue) => {
                        return (
                            <button onClick={() => window.alert(`Clicked "Edit" for row ${tableMeta.rowIndex}`)}>
                                Edit
                            </button>
                        );
                    }
                }
            },
            {
                name: "name",
                options: {
                    filter: true,
                }
            },
            {
                label: "Modified Title Label",
                name: "Title",
                options: {
                    filter: true,
                }
            },
            {
                name: "Location",
                options: {
                    filter: false,
                }
            },
            {
                name: "Age",
                options: {
                    filter: true,
                }
            },
            {
                name: "Salary",
                options: {
                    filter: true,
                    sort: false,
                }
            },
            {
                name: "Add",
                options: {
                    filter: true,
                    sort: false,
                    empty: true,
                    customBodyRender: (value, tableMeta, updateValue) => {
                        return (
                            <button onClick={() => {
                                const { data } = this.state;
                                data.unshift(["Mason Ray", "Computer Scientist", "San Francisco", 39, "$142,000"]);
                                this.setState({ data });
                            }}>
                                Add
                            </button>
                        );
                    }
                }
            },
        ];


        const options = {
            filter: true,
            filterType: 'dropdown',
            responsive: 'stacked',
            page: 2,
            onColumnSortChange: (changedColumn, direction) => console.log('changedColumn: ', changedColumn, 'direction: ', direction),
            onChangeRowsPerPage: numberOfRows => console.log('numberOfRows: ', numberOfRows),
            onChangePage: currentPage => console.log('currentPage: ', currentPage)
        };

        return (
            <MUIDataTable title={"ACME Employee list"} data={this.state.data} columns={columns} options={options} />
        );

    }

}
